import { Menu } from 'semantic-ui-react';


const Footer = () => {
	return (
		<div className="navbar">
			<div class="ui teal secondary  menu">
				<a class=" item" href="/">
				Register
				</a>
				<a class="item" href="/employee">
				Employees
				</a>
			</div>
		</div>
	)
}

export default Footer;
